/**
 * \brief Using ShellSort
 * \param vec
 * \param n
 * \return
 */

int Shell_Sort(int vec[], int n)
{
	for (int gap = n/2; gap > 0; gap /= 2)
	{
		for (int i = gap; i < n; i++)
		{
            int x = vec[i];
            int j;
            for (j = i; j > gap && vec[j - gap] > x; j -= gap)
                vec[j] = vec[j - gap];
            vec[j] = x;
		}
	}
    return 0;
}


/**
 * \brief Using Merge Sort
 */

void merge(int array[], int const left, int const mid,
    int const right)
{
    int const subArrayOne = mid - left + 1;
    int const subArrayTwo = right - mid;

    auto* leftArray = new int[subArrayOne],
        * rightArray = new int[subArrayTwo];

    for (auto p = 0; p < subArrayOne; p++)
        leftArray[p] = array[left + p];
    for (auto q = 0; q < subArrayTwo; q++)
        rightArray[q] = array[mid + 1 + q];

    auto indexOfSubArrayOne = 0, indexOfSubArrayTwo = 0;
    int indexOfMergedArray = left;

    while (indexOfSubArrayOne < subArrayOne
        && indexOfSubArrayTwo < subArrayTwo) {
        if (leftArray[indexOfSubArrayOne]
            <= rightArray[indexOfSubArrayTwo]) {
            array[indexOfMergedArray]
                = leftArray[indexOfSubArrayOne];
            indexOfSubArrayOne++;
        }
        else {
            array[indexOfMergedArray]
                = rightArray[indexOfSubArrayTwo];
            indexOfSubArrayTwo++;
        }
        indexOfMergedArray++;
    }

    while (indexOfSubArrayOne < subArrayOne) {
        array[indexOfMergedArray]
            = leftArray[indexOfSubArrayOne];
        indexOfSubArrayOne++;
        indexOfMergedArray++;
    }

    while (indexOfSubArrayTwo < subArrayTwo) {
        array[indexOfMergedArray]
            = rightArray[indexOfSubArrayTwo];
        indexOfSubArrayTwo++;
        indexOfMergedArray++;
    }
    delete[] leftArray;
    delete[] rightArray;
}

void mergeSort(int array[], int const begin, int const end)
{
    if (begin >= end)
        return;

    int mid = begin + (end - begin) / 2;
    mergeSort(array, begin, mid);
    mergeSort(array, mid + 1, end);
    merge(array, begin, mid, end);
}

void printArray(int A[], int size)
{
    for (int p = 0; p < size; p++)
        cout << A[p] << " ";
    cout << endl;
}



/**
 * \brief Using Bucket Sort
 */

void Bucket_Sort(float arrr[], int a)
{
    std::vector<std::vector<float>> bucket(a);
    for (int k = 0; k < a; k++)
    {
        int bi = a * arrr[k];
        bucket[bi].pb(arrr[k]);
    }
    for (int k = 0; k < a; k++)
        sort(bucket[k].begin(), bucket[k].end());
    int pos = 0;
    for (int k = 0; k < a; k++)
        for (int l = 0; l < bucket[k].size(); l++)
            arrr[pos++] = bucket[k][l];
}


